import React from 'react';

const List = ({ people }) => {
  return (
    <>
      <div>
        {people.name}
        <img src={people.profilePicture} alt={people.name} />
        <div>
          <h4>{people.name}</h4>
          {/* <p>{age} years</p> */}
        </div>
      </div>
    </>
  );
};

export default List;
